                                                "sequence": 10,
                                                "custom_resources": {
                                                    "web_description": "Les données à caractère personnel recueillies dans le cadre de cette opération font l’objet d’un traitement dont le responsable de traitement est l’assureur à l’exception des opérations dont le responsable de traitement et le périmètre sont définis à la notice d’information.\n\nLe traitement des données a pour finalité de satisfaire votre demande et de permettre la réalisation de mesures précontractuelles, d’actes de souscription, de gestion et d’exécution ultérieure. A ce titre, elles pourront être utilisées à des fins de recouvrement, d’exercice des recours et de gestion des réclamations et contentieux, d’examen, d’appréciation, de contrôle, de surveillance du risque et à des fins d’études statistiques et actuarielles. Ces traitements ont comme base juridique l’exécution du contrat ou de mesures précontractuelles.\n\nLes informations relatives aux données de santé sont traitées dans le cadre de la passation, la gestion et l'exécution du contrat (finalités mentionnées ci-dessus). Ce traitement a pour base juridique le consentement.\n\nEn remplissant le questionnaire médical, vous acceptez le traitement des données de santé dans ce cadre et vous acceptez le traitement des données de santé qui pourraient vous être demandées ultérieurement pour ces mêmes finalités.\n\nDans les conditions prévues par la réglementation :\n \nVous avez le droit :\n \n -   de retirer le consentement donné pour un traitement de données fondé sur cette base. Ce retrait vaut pour l’avenir et ne remet pas en cause la licéité des traitements déjà effectués,\n -   de prendre connaissance des informations vous concernant et le cas échéant de demander à les corriger notamment en cas de changement de situation,\n -   de demander d’effacer ou de limiter l’utilisation de vos données notamment lorsque ces dernières ne sont plus nécessaires\n -   de récupérer dans un format structuré les données que vous nous avez fournies lorsque ces dernières sont nécessaires au contrat ou lorsque vous avez consenti à l’utilisation de ces données.\n\nVous pouvez exercer ces droits sur simple demande après avoir fourni une preuve de votre identité :\n -   auprès du délégataire de gestion  NEVIDIS : à l’adresse mail [dpo@nevidis.fr](mailto:dpo@nevidis.fr) ou à l’adresse postale NEVIDIS 23 rue royale,75008 Paris.\n -   auprès de l’assureur : à l’adresse mail [droitdacces@generali.fr](mailto:droitdacces@generali.fr) ou à l’adresse postale Generali – Conformité - TSA 70100 75309 Paris Cedex 09.\n\nL’exercice de ces droits est susceptible de rendre impossible l’exécution du contrat, dès lors que ces données participent du consentement des parties à la contractualisation.\n\nPour plus d’informations sur le traitement de vos données et sur vos droits, nous vous invitons à consulter le paragraphe « Information sur la protection des données personnelles » figurant à la notice d’information.",
